import React from "react";

import { Typography, Card, makeStyles, Paper } from "@material-ui/core";

import Map from "../addons/Map";
const useStyles = makeStyles(() => ({
  root: {
    marginTop: "16px",
    padding: "64px",
  },
  welcome: {
    padding: "16px",
  },
}));
const HomePage = () => {
  const classes = useStyles();

  return (
    <Paper className={classes.root}>
      <Card className={classes.welcome}>
        <Typography variant="h5" color="primary">
          Faciliter la pratique de la classe dehors et l’apprentissage dehors
          pour les acteurs de l’éducation” puis bouton “voir le manifeste”.
        </Typography>
      </Card>
      <Map />
    </Paper>
  );
};

export default HomePage;
